class Solution:
    def longestPalindrome(self, s: str) -> str:
        L = len(s)
        if L == 1:
            return s
        max_p = s[0]
        def isPalindrome(word):
            if word == word[::-1]:
                return True
            else: return False
        
        max_len = 1
        for i in range(L):
            if max_len >= L-i:
                break
            for j in range(i, L):
                    target = s[i:j+1]
                    if isPalindrome(target) == True:
                        if len(target) > len(max_p):
                            max_p = target
                            max_len = len(target)
                    
        return max_p
        
case1 = "babad"

case2 = "cbbd"

